import '../App.css';
import React from 'react';



const About = () => {

return (
    <div className="App-about">
	    <body className="App-about-body">


		    <h1>About</h1>
		    <h2>I'm Pete and before COVID hit I was experimenting with stand up comedy as just a fun little challenge.  When COVID hit, I spent a lot of time learning how to code.  I was experimenting mostly with Python and 3D printing until I had the idea for Pobblebonk late in 2020.  The project is a long term and may be something I work on just through 2022 or it could potentially be something I just keep working on for the foreseeable future depending on people's interest and my interest.
		    </h2>
		    <br></br>
			    <h2>
			    I hope to expand more on what I'm doing but just know that I'm attempting to take stand up comedy into the future!</h2>





	    </body>

    </div>



);



}

export default About;
